        (c) University of Central Florida","questions":"Question: What is the tuition
        fee for the Physics (BS) Program? \n Answer: In State tuition is $212.28 per
        credit hour and Out of State Tuition is $748.89 per credit hour. \n Question:
        What are the degree requirements for the Physics (BS) program? \n Answer:
        Degree requirements include adopting the most current catalog upon change
        of degree programs. Grades below C (2.0) in any required physics or mathematics
        courses are not acceptable, they must be repeated with a higher grade. Cumulative
        GPA of 2.0 in all courses that could meet major requirements is a must. \n
        Question: What are the Undergraduate Application Deadlines? \n Answer: For
        freshers, the deadlines are May 1 for Fall, November 1 for Spring, and March
        1 for Summer. For Transfers, the deadlines are July 1 for Fall, November 1
        for Spring, and March 1 for Summer. \n Question: What specializations are
        available for the Physics (BS) degree? \n Answer: Physics majors can select
        from five distinct specializations including General Physics, Materials Physics,
        Optics and Lasers, Computational Physics and Astronomy. \n Question: What
        are the graduation requirements for the Physics (BS) program? \n Answer: While
        declared as a Physics BS major, students must complete the Professional Physics
        Mentoring Program annually. A minimum cumulative GPA of 2.0 is needed in all
        courses. In the last year, a nationally normed test in Physics is required
        alongside an exit interview in the last semester. \n","followups":"What are
